  return (
    <div className="ProgressBar">
      <div className='top'>
        <div className="title">
          <h2>Customers</h2>
        </div>
        <p>Customers that buy products</p>
      </div>
      <div className='bottom'>
      <div className='pb'>
      <CircularProgressbar value={65} text={'65%'} text1 ={'Total New Customers'}/><p>Total New Customers</p></div>
      </div>
    </div>
  );
}

export default Progress;
